HELENE HANFF
Este es un libro que me gustó muchísimo, y si tengo que definirlo en pocas palabras, puedo afirmar que es una caricia para el alma. Una compilación de cartas, una historia real es la esencia de este hermoso libro. Cuando lo ví por primera vez, me dije: "que chiquitito...". Pero cuando lo leí superó ampliamente mis expectativas y me asombró la profundidad de la historia y la grandeza de su relato. No quería que terminara.
La historia, bellísima, por cierto, trata de una escritora estadounidense que mantiene correspondencia durante 20 años con el personal de una librería de Londres. Todo comienza cuando Helen Hanff, la protagonista y escritora de este libro, decide profundizar sus conocimientos de literatura inglesa, pero por su elevado precio le resulta imposible comprar ejemplares antiguos en su propio país. Su pasión autodidacta por la literatura inglesa, su instinto "buscavidas", la llevan a contactarse con la librería anticuaria Marks & Co. de Londres, donde inicia el intercambio de libros y de su propia vida con las personas que trabajan allí. Primero entabla una relación con Frank Doel, un vendedor, y luego con el resto de los empleados. A medida que avanza la correspondencia, también el trato y la familiaridad. Se intercambian cartas, libros antiguos, encomiendas con regalos y vínculos que se consolidan a pesar de estar en distintos continentes.
Mi conclusión es que cuando el contacto se mantiene, la distancia es lo de menos. El amor a los libros, a los que nos gusta leer, que siempre hay algo que queremos encontrar y hasta que no lo conseguimos no paramos, ese caprichito de lector.
